import React, { useState } from 'react';
import { IonHeader, IonToolbar, IonButtons, IonButton, IonTitle, IonIcon, IonMenuButton, IonMenu, IonContent, IonItem, IonList} from '@ionic/react';

import '../css/Global.css';
import { arrowBackOutline } from 'ionicons/icons';

const Menu: React.FC = props => {

    return(
        <IonContent fullscreen>
            <IonMenu side="start" contentId="menu" menuId="first" id="menu">
                <IonHeader>
                    <IonToolbar color="primary">
                    <IonTitle>Start Menu</IonTitle>
                    </IonToolbar>
                </IonHeader>

                <IonContent>
                    <IonList>
                    <IonItem>Menu Item</IonItem>
                    <IonItem>Menu Item</IonItem>
                    <IonItem>Menu Item</IonItem>
                    <IonItem>Menu Item</IonItem>
                    <IonItem>Menu Item</IonItem>
                    </IonList>
                </IonContent>
            </IonMenu>
        </IonContent>
    );
}

export default Menu;
